  \"2004 progress report : Effects of ungulate browsing on post-fire recovery of riparian
  cottonwoods : Implications for management of riparian forests, Seedskadee National
  Wildlife Refuge, Wyoming\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T23:05:34.163450\",\n\t\"name\": \"2004-progress-report-effects-of-ungulate-browsing-on-post-fire-recovery-of-riparian-cotton\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Browsing pressure by ungulates may limit
  natural establishment of native cottonwood and willow stands, and fires, which have
  become more frequent on riparian lands due to continuing regional drought, can quickly
  eliminate large areas of existing riparian forest. Stem re-sprouting following fire
  has been reported for some cottonwood species; however, re-sprouts may attract browsing
  by ungulates, which may ultimately prevent recovery of riparian forest structure;
  an important habitat element for birds and other wildlife species. Although much
  research has focused on the effects of fire on upland forests, little work has been
  directed toward understanding the response of riparian cottonwoods and willows to
  wild-land fire. This study uses replicated browsing treatments to quantify the effects
  of ungulate browsing on survival and growth of post-fire narrow-leaf cottonwood
  re-sprouts, at three burn sites across the Refuge. These results could be used to
  design restoration strategies aimed at restoring cottonwood and riparian forests
  and the wildlife habitat values they provide. This document is a 2004 progress report.\",\n\t\"license_title\":
